import React from 'react';
// import Res from "./compan/basic/Res";
import {Routes,Route} from 'react-router-dom';
import Login from './componet/Login';
import LoginS from './componet/LoginS';

const App = () => {
  return (
    <>
    <Routes>
      <Login/>
      <Route path='/' element={<LoginS/>}></Route>
      </Routes>
    </>
  )
}

export default App
